/* eslint-disable import/no-mutable-exports */
import React, { useEffect, useState } from 'react';
import { useSelector } from 'react-redux';
import { useSearchParams } from 'react-router-dom';
import styled from 'styled-components';
import CareerConnectionBanner from './CareerConnectionBanner';
import { fetchUserProfile } from './fetchProfileData';
import ProfileAside from './ProfileAside';
import ProfileLevel1 from './ProfileLevel1';
import ProfileLevel2 from './ProfileLevel2';
import ProfileLevel3 from './ProfileLevel3';
import ProrfileLevel4 from './ProrfileLevel4';

// export let userProfileData = fetchUserProfile();

function ProfilePage() {
	const [searchParams, setSearchParams] = useSearchParams();
	const level = searchParams.get('level');
	const [testData, setTestData] = useState({});
	const { userId, jwt } = useSelector((state) => state.UserDataReducer);
	const userProfileData = fetchUserProfile({ userId, jwt });
	useEffect(() => {
		setTestData();
	}, []);

	return (
		<ComponentWrapper>
			<nav className="profile-title">
				<h2>
					<p>프로필</p>
				</h2>
			</nav>
			<div className="machup">
				<ProfileAside testData={userProfileData} />
				<section>
					<CareerConnectionBanner />
					{level === '4' && <ProrfileLevel4 />}
					{level === '3' && <ProfileLevel3 />}
					{level === '2' && <ProfileLevel2 />}
					{level === '1' && <ProfileLevel1 />}
				</section>
			</div>
		</ComponentWrapper>
	);
}
const ComponentWrapper = styled.div`
	padding-bottom: 100px;
	margin: 0 auto;
	width: 87.72%;
	position: relative;
	max-width: 1060px;

	.machup {
		margin: 0 auto;
		max-width: 1060px;
		position: relative;
		> section {
			padding-left: 270px;
		}
	}
	.profile-title {
		position: relative;
		line-height: normal;
		p {
			font-size: 20px;
			font-weight: 700;
			color: #333;
			padding: 50px 0 20px;
		}
	}
`;

export default ProfilePage;
